pragma solidity ^0.6.0;

import "./Context.sol";
import "./IERC721.sol";
import "./IERC721Receiver.sol";
import "./SafeMath.sol";
import "./Address.sol";
import "./Counters.sol";
import "./ERC165.sol";
import "./BokkyPooBahsDateTimeContract.sol";


/**
 * @title ERC721 Non-Fungible Token Standard basic implementation
 * @dev see https://eips.ethereum.org/EIPS/eip-721
 */
contract ERC721 is Context, ERC165, IERC721 {
    using SafeMath for uint256;
    using SafeMath for uint;
    using Address for address;
    using Counters for Counters.Counter;
    //using BokkyPooBahsDateTimeContract for addDays;

    // Equals to `bytes4(keccak256("onERC721Received(address,address,uint256,bytes)"))`
    // which can be also obtained as `IERC721Receiver(0).onERC721Received.selector`
    bytes4 private constant _ERC721_RECEIVED = 0x150b7a02;
    int public compteur = 0;

    // Mapping from token ID to owner
    mapping (uint256 => address) private _tokenOwner;

    // Mapping from token ID to approved address
    mapping (uint256 => address) private _tokenApprovals;

    // Mapping from owner to number of owned token
    mapping (address => Counters.Counter) private _ownedTokensCount;

    // Mapping from owner to operator approvals
    mapping (address => mapping (address => bool)) private _operatorApprovals;
    mapping (address => bool) userAddr;
    mapping (uint256 => animalobj) liste_animal;
    mapping(address=> uint) public argent_compte;
    mapping(address => bool) is_Challenged;
    mapping(uint256 => challenge) liste_challenges;


    function registerbreeder (address user, bool authorized) public   {
        userAddr[user] = authorized;
        argent_compte[user] = 0;

    }
    function deposit () public payable {
        argent_compte[_msgSender()] += msg.value;
    }
    function isRegistered(address user) public view returns(bool){
        return userAddr[user];
    }
    struct animalobj {
        string kind;
        string name;
        string couleur;
        bool is_Alive;
        uint256 parent1;
        uint256 parent2;


    }
    struct challenge {
        uint256 challenger;
        uint256 defender;
        uint stake;
        address challenger_own;
        address defender_own;
        bool authorisation_defender;
    }
    function declareAnimal(string memory kind1,string memory name1,string memory couleur1,bool etat,uint256 parents1,uint256 parents2, uint256 tokenId) public{
        liste_animal[tokenId].kind = kind1;
        liste_animal[tokenId].name = name1;
        liste_animal[tokenId].couleur = couleur1;
        liste_animal[tokenId].is_Alive = etat;
        liste_animal[tokenId].parent1 = parents1;
        liste_animal[tokenId].parent2 = parents2;
        _mint(_msgSender(),tokenId);




    }
    function deadanimal(uint256 tokenId) public {
        liste_animal[tokenId].is_Alive = false;
    }
    function breadAnimal(uint256 tokenId1,uint256 tokenId2,uint256 tokenId3,string memory name1) public  {
        address owner1 = ownerOf(tokenId1);
        address owner2 = ownerOf(tokenId2);

        require(owner1==owner2,"The two animals have different owners");
        liste_animal[tokenId3].parent1 = tokenId1;
        liste_animal[tokenId3].parent2 = tokenId2;
        liste_animal[tokenId3].kind = liste_animal[tokenId1].kind;
        liste_animal[tokenId3].name = name1;
        liste_animal[tokenId3].couleur = liste_animal[tokenId2].couleur;
        liste_animal[tokenId3].is_Alive = true;
        _mint(_msgSender(), tokenId3);


    }
    function proposeToFight(uint256 challenger1, uint256 defender1,uint stake1,uint256 numero_combat) public{
        address owner1 = ownerOf(challenger1);
        address owner2 = ownerOf(defender1);

        require(owner1==_msgSender(),"The message sender is not the owner of the challenger animal");

        require(argent_compte[owner1]>=stake1,"The challenger does not have enough money");

        liste_challenges[numero_combat].challenger = challenger1;
        liste_challenges[numero_combat].defender = defender1;
        liste_challenges[numero_combat].stake = stake1;
        liste_challenges[numero_combat].challenger_own = owner1;
        liste_challenges[numero_combat].defender_own = owner2;










    }
    function AgreeToFight(uint256 numero_combat) public {
        address owner1 = liste_challenges[numero_combat].challenger_own;
        address owner2 = liste_challenges[numero_combat].defender_own;

        require(owner2==_msgSender(),"The message sender is not the owner of the challenged animal");
        /* Je ne comprends pas pourquoi je ne peux pas utiliser d'operateur*/
        require(argent_compte[owner2]>=liste_challenges[numero_combat].stake,"The challenger does not have enough money");
        liste_challenges[numero_combat].authorisation_defender = true;
        argent_compte[owner1] = argent_compte[owner1]-liste_challenges[numero_combat].stake;
        argent_compte[owner2] = argent_compte[owner2]-liste_challenges[numero_combat].stake;

    }
    struct auction{

        uint  startBlock;
        uint endBlock;
        uint tokenId;
    }

    mapping (uint => auction) liste_auction;
    function Create_Auction(uint no_auction, uint start_auction, uint256 tokenId1) public {
        address auctioneer = ownerOf(tokenId1);
        require(auctioneer==_msgSender(),"The message sender is not the owner of the animal"); 
        liste_auction[no_auction].startBlock = start_auction;
        liste_auction[no_auction].endBlock = start_auction + 2 days;
        liste_auction[no_auction].tokenId = tokenId1;




    }
    function place_bid(uint no_auction, uint bid) public
    {
        require(block.timestamp <= liste_auction[no_auction].endBlock,"The auction has closed ");
        require(now <= liste_auction[no_auction].endBlock,"The auction has not started yet");




    }



